webpackJsonp([0x95de43d0a423],{1733:function(e,a){e.exports={data:{markdownRemark:{html:'<p>어제, 박사 학위 시상식이 열렸습니다. 저녁 10시에 그는 남쪽 지역에 가서 의사 3 명이 "모자"를 쓰고 아침 1 시까 지 돌아 오지 않았다. 우리가 학습에 관해 이야기했을 때, 모두는 여전히 그것을 누그러 뜨 렸습니다. 이것은 발정 그룹입니다.</p>\n<p>그들은 Pudong New Area 사회 개발국 (Pudong New Area Social Development Bureau)에 포럼을 열어 Pudong Social Development Report를 쓰도록 도와달라고 요청했습니다. 많은 전문가와 공무원이 많은 좋은 아이디어를 내놓았습니다. 이 사회 발전 보고서와 관련하여 모든 사람들은 다른 방향을 가지고 있습니다. 이제는 개발 보고서를 작성하는 관행이 대중화되었으며 의사 결정에 도움이되어야하며 추세와 경향을 파악할뿐만 아니라 의사 결정을위한보다 폭 넓은 이론적 사고와 데이터 기반을 제공 할 수 있습니다. 개발 보고서 등의 일반적인 원칙은 다음과 같습니다.</p>\n<p>주제없는 비 이념적 사상 및 비 이데올로기 정적 및 동적 데이터 분석 및 비 데이터 기반 전략 및 지시 및 비 지시 형 표제 및 비표준 유도 및 비유도 전략의 비 측정</p>\n<p>회의 책 중에, "상하이의 푸동 신구, 사회 선진적 및 전략 기획 연구의 발전"의 관점은 제안 된 개발의 가치가 기사가되어 사회적, 경제적 인간 중심의 개발 전략의 수립, 인적 자원은 매우 중요한 투자입니다 환경. 모든 발전은 궁극적으로 인간의 발전을위한 것이며 인간의 완전한 발전이기도합니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0180.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0180.md",frontmatter:{title:"11월 8일 화요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0180.md absPath of file >>> MarkdownRemark"}}}});
